function Header({ isMobileMenuOpened }) {
  return (
    <header className="header">
        <img className="header__logo" src={logoPath} alt="Логотип Место"/>
        <div className="header__menu">
          <a className="header__menu-email">uvaleks@mail.ru</a>
          <a className="header__menu-button">Войти</a>
        </div>
        <a onClick={handeleM} className={`header__menu-burger ${isMobileMenuOpened ? 'header__menu-burger_icon_close' : 'header__menu-burger_icon_burger'}`}></a>
    </header>
  );
}

export default Header;
